import MovieCard from "./MovieCard";
import "../index.css";

function MovieList() {
  const movies = [1, 2, 3, 4, 5, 6];
  return (
    <div className="movielist">
      {movies.map((movie) => (
        <MovieCard
          title="Man of Steel"
          description="Political involvement in the Avengers' affairs causes a rift between Captain America and Iron Man. With many people fearing the actions of super heroes, the government decides to push for the Hero Registration Act, a law that limits a hero's actions. This results in a division in The Avengers."
          posterUrl
        />
      ))}
    </div>
  );
}

export default MovieList;
